<#
This example is used to test new resources and showcase the usage of new resources being worked on.
It is not meant to use as a production baseline.
#>

Configuration Example
{
    param(
        [Parameter(Mandatory = $true)]
        [PSCredential]
        $Credscredential
    )
    Import-DscResource -ModuleName Microsoft365DSC

    node localhost
    {
        IntuneDeviceConfigurationDefenderForEndpointOnboardingPolicyWindows10 'Example'
        {
            AdvancedThreatProtectionAutoPopulateOnboardingBlob = $False;
            AdvancedThreatProtectionOnboardingBlob             = "<EncryptedMessage xmlns=`"http://schemas.datacontract.org/2004/07/Microsoft.Management.Services.Common.Cryptography`" xmlns:i=`"http://www.w3.org/2001/XMLSchema-instance`"><EncryptedContent></EncryptedContent><RecipientCertThumbprints xmlns:a=`"http://schemas.microsoft.com/2003/10/Serialization/Arrays`"><a:string>D97F84CD027F883C2A6A7B4F1B8A194EF3042369</a:string></RecipientCertThumbprints></EncryptedMessage>";
            AdvancedThreatProtectionOnboardingFilename         = "WindowsDefenderATP.onboarding";
            AllowSampleSharing                                 = $True;
            Assignments                                        = @(
                MSFT_DeviceManagementConfigurationPolicyAssignments{
                    deviceAndAppManagementAssignmentFilterType = 'none'
                    dataType = '#microsoft.graph.allDevicesAssignmentTarget'
                }
            );
            Credential                                         = $Credscredential;
            DisplayName                                        = "MDE onboarding Legacy";
            EnableExpeditedTelemetryReporting                  = $True;
            Ensure                                             = "Present";
        }
    }
}
